    subUnitList = topics[unit - 1].map((title, index) => <li><Link to={`/unit${unit}_${index}`} className='subunit'>{title}</Link></li>);
  }
  let subUnitRoutes;
  if (unit - 1 < topics.length) {
    subUnitRoutes = topics[unit - 1].map((title, index) => <Route path={`/unit${unit}_${index}`} element={<Page unit={unit} index={index} />}></Route>);
  }
  return (
    <div>
      <BrowserRouter>
        <Header />
        <NavBar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/home" element={<Home />} />
          <Route path="/about" element={<About />} />
          {topics.map((list, index) => <Route path={``}></Route>)}
          <Route path="/unit1" element={<Unit unit={1} />} />
          <Route path="/unit2" element={<Unit unit={2} />} />
          <Route path="/unit3" element={<Unit unit={3} />} />
          <Route path="/unit4" element={<Unit unit={4} />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}
export default App;
